exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`https://www.rzlib.net/b/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="ListChapter"[^>]*>/,"</ul>",-1),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};